import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () =>{
    return (
        <div className="box_center">
            <ul>
                <NavLink exact activeClassName="Linkhover" to="/"><li>Home</li></NavLink>
                <NavLink exact activeClassName="Linkhover" to="/creatnote"><li>Component</li></NavLink>
                <NavLink exact activeClassName="Linkhover" to="/note"><li>Note</li></NavLink>
                <NavLink exact activeClassName="Linkhover" to="/render"><li>Render</li></NavLink>
                <NavLink exact activeClassName="Linkhover" to="/user"><li>User</li></NavLink>
            </ul>
        </div>
    );
};
export default Menu;
